DROP TABLE IF EXISTS `pay_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pay_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orderid` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '订单号',
  `ordertype` int(10) NOT NULL DEFAULT '1' COMMENT '订单类型',
  `value` varchar(255) NOT NULL DEFAULT '' COMMENT '商品内容',
  `user` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '充值账号',
  `roleid` int(255) NOT NULL COMMENT '角色ID',
  `rolename` varchar(255) NOT NULL COMMENT '角色名称',
  `qu` int(255) NOT NULL COMMENT '所属大区',
  `agent` varchar(225) NOT NULL COMMENT '代理账号',
  `money` decimal(10,2) NOT NULL COMMENT '支付金额',
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '支付状态',
  `ip` varchar(255) NOT NULL COMMENT '支付ip',
  `city` varchar(255) NOT NULL COMMENT '城市',
  `date` varchar(255) NOT NULL COMMENT '日期',
  `time` varchar(255) NOT NULL COMMENT '时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
